```solidity
pragma solidity >=0.4.22 <0.9.0;

contract MyContract {
    address public owner2;
    address public owner4;
    address public owner5;
    uint256 public deadline6;
    uint256 public deadline;
    uint256 public deadline1;
    uint256 public deadline2;
    uint256 public deadline3;
    uint256 public deadline4;
    uint256 public deadline5;
    uint256 public s_18;
    uint256 public totalSupply2;

    constructor() payable {
        owner2 = msg.sender;
        owner4 = 0xe56E60dE6d2649d9Cd0c82cb1f9d00365f07BA92;
        owner5 = 0x5731340239D8105F9F4e436021Ad29D3098AB6f8;
        deadline6 = 0x5bc3d880;
        deadline = 0x5becb700;
        deadline1 = 0x5bc67b80;
        deadline2 = 0x5bd10780;
        deadline3 = 0x5bdb9380;
        deadline4 = 0x5be61f80;
        deadline5 = 0x5becb700;
        s_18 = 0x3796274caf64c71000000;
        totalSupply2 = 0x1c4a21b706fa254f000000;
    }
}
```
This contract has a payable constructor which means it can receive Ether at the time of deployment. The constructor updates all the state variables with the specified values. The address of the account deploying the contract is assigned to `owner2` and the given addresses are assigned to `owner4` and `owner5`. The given values are then assigned to the `deadline` variables, `s_18` and `totalSupply2`.
